import React, { Component } from 'react'
import { connect } from 'react-redux'

class ShowKlassAllProgressions extends Component {

  renderStudentSummary = () => {
    const { student } = this.state
    const { progressions, studentProgressions, reflections, currentUser } = this.props
    if (student) {
      const myProgs = getStudentProgressions(student, studentProgressions, progressions)
      return (
        <StudentShowSummary
          currentUser={currentUser}
          student={student}
          reflections={reflections}
          progressions={myProgs}/>
      )
    }
  }

  render(){
    return (
      <div>
        ShowKlassAllProgressions
      </div>
    )
  }
}

function mapStateToProps(state){
  return {
    progressions: state.progressions,
    studentProgressinos: state.studentProgressions,
    reflections: state.reflections,
    students: state.students
  }
}

export default connect(mapStateToProps, null)(ShowKlassAllProgressions)
